{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/angeldark92/google-data-analysis-capstone-project-with-r?scriptVersionId=103099390\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"743c2552","metadata":{"papermill":{"duration":0.007258,"end_time":"2022-08-12T01:28:40.198293","exception":false,"start_time":"2022-08-12T01:28:40.191035","status":"completed"},"tags":[]},"source":["# Case Study from Google Data Analysis Program\n","\n","This is the case study 2 from the google data analysis program on Coursera. It includes every step for a successful data analysis: Ask (to identify the business task), Prepare (the data to analyse and verify it), Process (filter and check data for errors), Analyze, Share (visualizations and presentation of the findings), Act (recommendations for the company).\n","\n","## Company Background: Ballbeat \n","Urška Sršen and Sando Mur founded Bellabeat, a high-tech company that manufactures health-focused smart products.\n","Sršen used her background as an artist to develop beautifully designed technology that informs and inspires women around the world. Collecting data on activity, sleep, stress, and reproductive health has allowed Bellabeat to empower women with knowledge about their own health and habits. Since it was founded in 2013, Bellabeat has grown rapidly and quickly positioned itself as a tech-driven wellness company for women.\n","\n","<center><img src=\"https://i.ibb.co/jgxC3f5/beallabeat-leaf-fitness-tracker-smart-jewellery-feature-1050x580.jpg\" width=\"525px\" height=\"290px\"></center>\n","\n","## Business task\n","Analyze smart device usage data in order to gain insight into how customers use non-Ballbeat smart devices. Identify the trends that can apply to Ballbeat customers and finalize a marketing strategy for Ballbeat products. \n","\n","## Description of the Modus Operandi and Data Used\n","The data used will be fitbit, and various fitness trackers which are the closest products to \"Time\" their wellness watch and \"Leaf\" their wellness tracker. These two products can track user activity, sleep and stress. Activity, stress and sleep is what I am going to focus on."]},{"cell_type":"markdown","id":"0430e23c","metadata":{"papermill":{"duration":0.00593,"end_time":"2022-08-12T01:28:40.211024","exception":false,"start_time":"2022-08-12T01:28:40.205094","status":"completed"},"tags":[]},"source":["Starting by installing and loading the required packages:"]},{"cell_type":"code","execution_count":1,"id":"8ae5770e","metadata":{"execution":{"iopub.execute_input":"2022-08-12T01:28:40.228242Z","iopub.status.busy":"2022-08-12T01:28:40.225869Z","iopub.status.idle":"2022-08-12T01:29:49.757982Z","shell.execute_reply":"2022-08-12T01:29:49.756306Z"},"papermill":{"duration":69.544789,"end_time":"2022-08-12T01:29:49.761867","exception":false,"start_time":"2022-08-12T01:28:40.217078","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","also installing the dependency ‘reprex’\n","\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.2 ──\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.6     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.7     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.9\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.0     