of 25 is not too bad. But FFMI should be considered instead as people who use fitness trackers can have higher amounts of muscle and skew the BMI. \n","\n","* **Trackers Selling Price and Battery Life:**\n","Ballbeat should at least meet the requirements of mean battery life and price, they both seem to be directly correlated. A later plot will show the correlation.\n","\n","\n","### Merging Two Datasets\n","Merging the data will help identify sleep abnormalities and correlations. It will give less data to work with (inner join) but the correlations might still give some valuable insights."]},{"cell_type":"code","execution_count":16,"id":"4e275387","metadata":{"execution":{"iopub.execute_input":"2022-08-12T01:29:50.757506Z","iopub.status.busy":"2022-08-12T01:29:50.745666Z","iopub.status.idle":"2022-08-12T01:29:50.793981Z","shell.execute_reply":"2022-08-12T01:29:50.791686Z"},"papermill":{"duration":0.061515,"end_time":"2022-08-12T01:29:50.796034","exception":false,"start_time":"2022-08-12T01:29:50.734519","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["24"],"text/latex":["24"],"text/markdown":["24"],"text/plain":["[1] 24"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["8"],"text/latex":["8"],"text/markdown":["8"],"text/plain":["[1] 8"]},"metadata":{},"output_type":"display_data"}],"source":["merged <- merge(daily_activity_fitbit, daily_sleep_fitbit, by=c(\"Id\",\"Date\"))\n","merged2 <- merge(daily_activity_fitbit, weight_fitbit, by=c(\"Id\") )\n","n_distinct(merged$Id)\n","n_distinct(merged2$Id)"]},{"cell_type":"markdown","id":"72dab3b3","metadata":{"papermill":{"duration":0.010073,"end_time":"2022-08-12T01:29:50.81625","exception":false,"start_time":"2022-08-12T01:29:50.806177","status":"completed"},"tags":[]},"source":["## Plotting Data to Visually Find Correlations\n","\n","Grouping by Id and finding the mean of Sedentary minutes and Total Steps taken will help with quickly visualizing the data while keeping the same distri