,"exception":false,"start_time":"2022-08-12T01:29:55.232185","status":"completed"},"tags":[]},"source":["## Final Recommendations\n","The marketing strategy should focus on women who do not but want to take part in meaningful activities so that the app and tracker can help with notifications through traking. These notifications should include:\n","\n","* A sleep alarm to advise to go to sleep and wake up in order to normalize circadian rhythm.\n","* Sedentary time should be kept to the essential and the suggested activity should vary between anaerobic and aerobic and heavier activity overall.\n","* The pricing and battery life should be in the 2500 rupees or roughly 35 euros with 8-13 days battery range.\n","* An algorithm that differentiates through strolling, walking, brisk walking and running by using time between each step and distance travelled with the added aid of an accellerometer for the slope would help people make better decisions and Ballbeat further stand out in the overcrowded market of fitness trackers (424 different models and counting).\n","\n","## Thanks for reading!\n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":78.468356,"end_time":"2022-08-12T01:29:55.384777","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-08-12T01:28:36.916421","version":"2.3.4"}},"nbformat":4,"nbformat_minor":5}